import React, { useState } from "react";
import Card from "./Card";

const Deck = ({takeTurn}) => {
    const [deck, shuffle] = useState([<Card text={'test text for deck'} takeTurn={takeTurn}/>]);

    return(
        {deck}
    );
}

export default Deck;
